import React from "react";
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";
import {
  TeamPage, 
  ProjectsPage,
  MainPage,
  SayHiPage
} from "../components/pages";
import {routes} from '../utils';

const Router = () => (
  <BrowserRouter>
    <Switch>
      <Route exact path={routes.team}>
        <TeamPage />
      </Route>
      <Route exact path={routes.projects}>
        <ProjectsPage/>
      </Route>
      <Route exact path={routes.sayHi}>
        <SayHiPage/>
      </Route>
      <Route path={routes.mainPage}>
        <MainPage />
      </Route>
    </Switch>
  </BrowserRouter>
);

export default Router;
